import styled from "styled-components";
import { useSelector } from "react-redux";
import { useEffect } from "react";
import { useHistory } from "react-router";

import { ComponentHeaderAuth } from "@components";
import { selectAuth, selectMerchant } from "@redux";
import { ModuleEmail } from "@modules";
import { enumExternalMethod, PATH_SIGN_UP_EMAIL } from "@configs";

export const PageSignUpTelFrom = () => {
    //page variable
    const merchant = useSelector(selectMerchant);
    const history = useHistory();
    //page variable
    const isGgSignUp = useSelector(selectAuth).externalLogin;

    return (
        <StyledContainer color={merchant.themeColor}>
            <ComponentHeaderAuth />
            <ModuleEmail />
        </StyledContainer>
    );
};

const StyledContainer = styled.div<{ color: string }>``;
